INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, '<div class="how-it-works"><h2 class="block-title">How It Works</h2><p>Artiplaq lets you permanently preserve and display maps, photos, posters, prints and more.</p><ol><li><strong>Upload</strong> your digital image or choose from our large selection of nautical charts.</li><li><strong>We’ll custom mount</strong>, laminate and finish the edges of your new plaque at our workshopin Maine.</li><li><strong>Enjoy </strong>your art.Custom plaque mounted, shipped right to your door, ready to hang.</li></ol><p style="margin:15px 0 20px 10px;"><a class="green-btn" href="#">get started</a></p><p>Prefer to order in person? <a href="#">FIND A DEALER</a></p></div><p>&nbsp;</p>', 'how it works', 'full_html'),
(2, '<p><img alt="" src="/sites/default/files/artiplaq.footer.png" style="width: 162px; height: 41px;"></p><p>ARTIPLAQ is a family-owned comapny in Maine providing<br>exceptional quality custom plaque mounting. Made in the USA.</p><p>© ARTiPLAQ™ Inc. <a href="#">Terms of Use</a>&nbsp;|&nbsp; <a href="#">Privacy Policy</a></p>', 'Artiplaq Footer', 'full_html'),
(3, '<p>Family owned &amp; OPERATED IN MAINE, USA</p>', 'Family owned & OPERATED IN MAINE, USA', 'full_html'),
(4, '<div class="follow-us">\r\n<label>Follow us:</label>\r\n<ul><li><a href="http://facebook.com" class="facebook-icon">&nbsp;</a></li><li><a href="http://pintrest.com" class="pintrest-icon">&nbsp;</a></li></ul></div>', 'Follow Us', 'full_html'),
(5, '<ul><li>We are authorized NOAA charts agents selling up-to-date,current nautical charts.</li><li>The paper chart you select can be ARTiPLAQ- mounted to a wood substrate with finished edges, laminated with matte finish, and ready to hang on the wall.</li><li>No glare. No glass. UV protected.</li><li>Indoor usage only.</li><li>Allow two weeks for us to mount and ship.</li></ul>', 'Nautical Chart Details', 'full_html');
