INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'slider', 0, 1, 1, 'und', 0, '<h2>Turn your photos into long-lasting<img alt="" src="/sites/default/files/art.png" style="width: 129px; height: 72px;bottom: -15px; right: -97px;"></h2><ul><li>Affordable alternative to custom framing.</li><li>UV laminated &amp; permanently mounted on wood.</li><li>Won’t buckle, wrinkle or fade.</li><li>No glare, no glass.</li><li>Comes ready to hang.</li></ul><p><a class="green-btn" href="#">get started</a></p>', '', 'full_html'),
('node', 'slider', 0, 2, 2, 'und', 0, '<h2><span style="color:#f0fff0;">custom mounted nautical</span> <img alt="" src="/sites/default/files/charts.png" style="width: 183px; height: 87px;"></h2><p><span style="color:#f0fff0;">Add the perfect touch to your home, office,<br>or cottage far from the sea. ARTIPLAQ<br>NOAA nautical charts are custom mounted<br>in Maine for a frame-free, contemporary look<br>that won’t warp or fade.</span></p><p><a class="white-btn" href="#">get started</a></p>', '', 'full_html'),
('node', 'page', 0, 3, 3, 'und', 0, '<p><img alt="" src="/sites/default/files/home-page-content.png" style="width: 557px; height: 249px;"></p><p><strong>CUSTOM WOOD PLAQUE MOUNTING</strong></p><p>ARTIPLAQ wood plaque mounting is an affordable alternative to custom picture framing for your photos, posters, prints and more.<br><br>Your image is printed on archival paper, UV protected and permanently bonded to wood so it will not buckle, wrinkle or fade. No glare. No glass. Edges are finished in a variety of colors for a frame-free contemporary look that comes ready to hang.<br><br>Our custom wood mounting for photos, artwork and nautical charts is of the highest quality, made in the USA by a family-owned workshop in Maine.</p>', '', 'full_html'),
('node', 'page', 0, 4, 4, 'und', 0, '<p><img alt="" src="/sites/default/files/about-us.png" style="width: 222px; height: 308px; float: right;">Warm greetings!<br><br>Nulla orci sapien, mollis id euismod id, lacinia et arcu. Duis arcu<br>nunc, interdum in hendrerit in,pellentesque ac tortor. Aliquam<br>iaculis tristique elit sit amet tincidunt. Aliquam ultricies ornare<br>felis, ut vehicula sapien dictum vel.<br><br>FAMILY OWNED, MADE IN MAINE<br>Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Morbi at turpis sit amet lectus egestas iaculis id nec lacus. In at dui nibh.<br><br>Mauris eros libero, suscipit et ullamcorper volutpat, lobortis eu orci</p><p>Pellentesque fringilla aliquam ante sit amet semper. Etiam commodo<br>volutpat sem, in sagittis est tristique sed.<br><br>CUSTOM WOOD PLAQUE MOUNTING<br>Suspendisse id orci id dui sodales dapibus. Nullam sed condimentum dolor. Nulla tincidunt enim massa, eget lacinia eros.<br><br>Nullam accumsan lectus quis turpis malesuada id ultrices arcu dictum. In at dolor nec enim imperdiet vulputate. Nulla facilisi. Morbi vel libero mauris, a dapibus felis. Mauris dui sapien, consectetur nec ultrices sed, pulvinar in neque. Aliquam eu elit lorem, et ultricies urna.</p>', '', 'full_html'),
('node', 'nautical_charts', 0, 22, 22, 'und', 0, '<p>Integer volutpat, lectus et suscipit bibendum, elit tellus ultrices diam, sit amet mattis augue metus in tellus Pellentesque pretium sagittis blandit. Ut eros nisi, sollicitudin eu tincidunt interdum.</p>', '', 'full_html'),
('node', 'posters_prints', 0, 28, 28, 'und', 0, '<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>', '', 'full_html'),
('node', 'posters_prints', 0, 29, 29, 'und', 0, '<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>', '', 'full_html');
